I'll help you list Slack channels related to your banking software project. To do this, I'll need to fetch all available channels and then identify those related to your banking project.

<tool>
{
  "server_name": "slack",
  "tool_name": "slack_list_channels",
  "inputs": {
    "limit": 100
  }
}
</tool>

It seems I've received only a partial list of channels. Let me continue fetching to see if there are any channels specifically related to your banking software project.

